import Navbar from "./components/NavBar/navbar";
import Home from "./components/Home/home";
import About from "./components/About Me/about";

function App() {
  return (
    <div classname="App">
      <section id="navbar">
      <Navbar/>
      </section>
      <section id="home"></section>
      <Home />
      <About />
    </div>
  );
}

export default App;
